    /**
     * Convert string to boolean
     *
     * @param {String} value
     * @param {boolean} defaultValue
     * @returns {boolean}
     */
    GetAsBoolean: function (value, defaultValue) {
      var ret = String(value).toLowerCase();
      switch (ret) {
        case "true":
        case "1":
        case "-1":
          ret = true;
          break;
        case "false":
        case "0":
          ret = false;
          break;
        case "null":
        case "undefined":
          ret = null;
          break;

        default:
          ret = GetAsBoolean(defaultValue);
          break;
      }
      return ret;
    },
